import logo from './logo.svg';
import './App.css';
import Login from './component/Login';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Login/>
      <Router>
        <Routes>
        <Route path="/reg" exact element={<Registration/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
